n. Der Vorwurf: Marktmissbrauch. Weko-Angaben zufolge gingen in den vergangenen Monaten noch weitere Meldungen zu Kooperationen zwischen Elektrizit\xE4tsversorgern und der Swisscom bei der Wettbewerbsbeh\xF6rde ein. Als erste Stadt habe St. Gallen einzelne Klauseln ihres Kooperationsvertrages im Rahmen eines Widerspruchsverfahrens zur \xDCberpr\xFCfung gemeldet, weshalb diese Kooperation auch als erste beurteilt werde. Bei diesen Vertragsklauseln sehe die Weko teilweise 'wettbewerbsrechtliche Probleme', weshalb sie jetzt eine Vorabkl\xE4rung er\xF6ffnet habe. Die ausgehandelten Vertragsklauseln, so die Weko, 'k\xF6nnten gem\xE4\xDF einer ersten Einsch\xE4tzung den Wettbewerb nachhaltig beschr\xE4nken und langfristig zu einer Monopolisierung der Glasfasernetzinfrastruktur f\xFChren'. Ins Visier nehmen die Wettbewerbsh\xFCter auch die geplante Gr\xFCndung eines Gemeinschaftsunternehmens zwischen der Swisscom und dem Energieversorger Groupe E zum Aufbau und Betrieb einer gemeinsamen Glasfaserinfrastruktur im Kanton Freiburg. Hier best\xFCnden Anhaltspunkte, dass das Gemeinschaftsunternehmen 'eine marktbeherrschende Stellung begr\xFCndet oder verst\xE4rkt'. (pmz) ",hxc='Dimension',ejc='Dimension [height=',xtc='DirectionalTextHelper',Atc='DockLayoutPanel',Btc='DockLayoutPanel$Direction',Ctc='DockLayoutPanel$Direction;',Ftc='DockLayoutPanel$DockAnimateCommand',Dtc='DockLayoutPanel$LayoutData',Kpc='DomEvent',Ppc='DomEvent$Type',Rvc='Double',ggc='EAST',uac='EEE, d MMM yyyy HH:mm:ss Z',Zlc='EEE. dd MMM. yyyy HH:mm:ss',Oac='EEEE, MMMM d',xac='EEEE, MMMM d, y',_7b='EM',Pdc='EMPTY',Udc='ENABLED',_bc='END',b8b='EX',fsc='ElementMapperImpl',gsc='ElementMapperImpl$FreeNode',Qbc='English',Xoc='Enum',Hbc='Etc/GMT',Jbc='Etc/GMT+',Ibc='Etc/GMT-',q8b='Event type',Xuc='Event$NativePreviewEvent',aqc='EventBus',moc='EventObject',roc='Exception',Oec='Expecting version 6 from server, got ',l9b='F',gkc='F8834F07517EF3B7D02B9E845E5E1B88',W7b='FIXED',kfc='FLOAT',Qjc='Fail: ',F9b='Feb',t9b='Febr
